import React, { ReactElement } from "react";
import styled from "styled-components/native";
import { SafeAreaView } from "react-native-safe-area-context";

interface Props {}

export default function Timeline({}: Props): ReactElement {
  return <Styled.container></Styled.container>;
}

const Styled = {
  container: styled(SafeAreaView)`
    flex: 1;
  `,
  heading: styled.Text``,
  availability: styled.View`
    background-color: #fff;
    box-shadow: 0px 8px 40px rgba(66, 83, 146, 0.12);
    border-radius: 12px;
    width: 320px;
    height: 234px;
    margin: 20px auto;
  `,
};
